import React, { useEffect } from 'react'
import { useDispatch, useSelector } from 'react-redux'
import { getAllStarships } from '../Redux/Actions/index'

export default function Starships() {
    const dispatch = useDispatch()
    const starshipsSW = useSelector((state) => state.starships)
    
    useEffect(() => {
        dispatch(getAllStarships())
    },[])

    return (
        <div className='Starships'>
            {starshipsSW ? starshipsSW.results.map(starship => <h3>{starship.name}</h3>): <h3>Cargando</h3>}
        </div>
    )
}
